contracts/ABCall.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ABCall_Store_HASH_G3 {
    mapping(uint => bytes32) public hashes;
    uint public hashCount;

    function storeHash(bytes32 _hash) public {
        hashes[hashCount] = _hash;
        hashCount++;
    }

    function getHash(uint _index) public view returns (bytes32) {
        require(_index < hashCount, "Index out of bounds");
        return hashes[_index];
    }
}

